import { ADD_TODOITEM } from '../action/actionTypes';
const initialState = {
  init: [],
};

export default (state = initialState, action) => {
  switch (action.type) {
    case ADD_TODOITEM:
      console.log('reducer');
    case CHECKBOX_CLICK:
      console.log('reducer click');

    default:
      return state;
  }
};
